INSERT INTO `TEXTO` VALUES (1,'<p>La <strong>introducci√≥n</strong> es la secci√≥n inicial de un texto en la que se contextualiza y brinda al lector la informaci√≥n previa del tema que ser√° tratado en el desarrollo posterior y en las <a href=\"https://www.ejemplos.co/15-ejemplos-de-conclusion/\" target=\"_blank\">conclusiones</a>.</p><p>Se utilizan introducciones para comenzar un libro, un ensayo, un <a href=\"https://www.ejemplos.co/ejemplos-de-articulo-cientifico/\" target=\"_blank\">art√≠culo</a>, un <a href=\"https://www.ejemplos.co/proyecto-de-investigacion-informacion-ejemplos/\" target=\"_blank\">texto de investigaci√≥n</a>, una biograf√≠a, etc.</p><p>La introducci√≥n es la primera oportunidad que tiene el autor de dirigirse al lector y, por lo tanto, el momento de brindarle las herramientas conceptuales para su lectura o para aclararle informaci√≥n pertinente sobre lo que est√° por leer.</p><p>En una introducci√≥n se suelen utilizar <a href=\"https://www.ejemplos.co/nexos-de-orden/\" target=\"_blank\">nexos de orden</a>, para organizar el contenido que va a ir anticipando el texto. Su extensi√≥n puede variar, pero siempre la introducci√≥n est√° ubicada al inicio. En un art√≠culo breve puede no ser m√°s que un p√°rrafo, mientras que en una tesis acad√©mica com√∫nmente consistir√° en varias p√°ginas de discurso fluido.</p>',1),(2,'<p>La <strong>justificaci√≥n</strong> a la parte de un <a href=\"https://www.ejemplos.co/proyecto-de-investigacion-informacion-ejemplos/\" target=\"_blank\">proyecto de investigaci√≥n</a> que expone las razones que motivaron a realizar esa investigaci√≥n. La justificaci√≥n es la secci√≥n en la que se explica la importancia y los motivos que llevaron al investigador a realizar el trabajo.</p><p>En la justificaci√≥n se explica al lector por qu√© y para qu√© se investig√≥ el tema elegido. En forma general, los motivos que el investigador puede dar en una justificaci√≥n pueden ser que su trabajo permite construir o refutar teor√≠as; aportar un nuevo enfoque o perspectiva sobre el tema; contribuir a la soluci√≥n de un problema concreto (social, econ√≥mico, ambiental, etc.) que afecta a determinadas personas; generar datos <a href=\"https://www.ejemplos.co/12-ejemplos-de-conocimiento-empirico/\" target=\"_blank\">emp√≠ricos</a> significativos y reutilizables; aclarar las causas y consecuencias de un determinado fen√≥meno de inter√©s; entre otras.</p><p>Entre los criterios utilizados para redactar una justificaci√≥n se toman en cuenta la utilidad de la investigaci√≥n para otros acad√©micos o bien para otros sectores sociales (funcionarios p√∫blicos, empresas, sectores de la sociedad civil), la trascendencia en el tiempo que puede tener, el aporte de nuevas herramientas o t√©cnicas de investigaci√≥n, la actualizaci√≥n de conocimientos preexistentes, entre otros. Adem√°s, el lenguaje debe ser formal y <a href=\"https://www.ejemplos.co/10-ejemplos-de-textos-descriptivos/\" target=\"_blank\">descriptivo</a>.</p>',2);
